import React, { useState, useEffect } from "react";
import { executeDevices } from "../services/api"; // Use the executeDevices function from API service
import { useNavigate } from "react-router-dom";
import "./Dashboard.css"; // Import the new CSS file

const Dashboard = () => {
  const [file, setFile] = useState(null);
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  // Check if the token exists in localStorage, otherwise redirect to login
  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login"); // Redirect to login if token is missing
    }
  }, [navigate]);

  const handleFileUpload = async (e) => {
    e.preventDefault();

    if (!file) {
      setError("Please upload a valid YAML file.");
      return;
    }

    setLoading(true);
    setError(null);

    try {
      const response = await executeDevices(file); // Use the executeDevices function
      if (response.success) {
        setResults(response.data.results); // Set results from backend response
      } else {
        setError(response.message);
      }
    } catch (error) {
      console.error("Error uploading file:", error);
      setError("Failed to execute commands. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h2>Device Management</h2>
        <p>Upload a YAML file to execute commands on devices.</p>
      </div>

      <form onSubmit={handleFileUpload} className="file-upload-form">
        <div className="file-input-group">
          <label htmlFor="file-upload" className="file-label">
            Select YAML File
          </label>
          <input
            id="file-upload"
            type="file"
            onChange={(e) => setFile(e.target.files[0])}
            className="file-input"
          />
        </div>
        <button type="submit" disabled={loading} className="submit-button">
          {loading ? "Executing..." : "Execute"}
        </button>
      </form>

      {error && <p className="error-message">{error}</p>}

      <div className="results-section">
        <h3>Execution Results:</h3>
        {results.length === 0 ? (
          <p>No results to display yet.</p>
        ) : (
          <div className="results-list">
            {results.map((result, index) => (
              <div key={index} className="result-card">
                <h4>Device: {result.device}</h4>
                <ul>
                  {result.results.map((action, idx) => (
                    <li key={idx} className={`action-result ${action.result.status}`}>
                      <strong>Action:</strong> {action.action} <br />
                      <strong>Service:</strong> {action.service} <br />
                      <strong>Status:</strong> {action.result.status === "success" ? "✔️ Success" : "❌ Failure"} <br />
                      <strong>Output:</strong>
                      <pre>{action.result.output || "No output"}</pre>
                      <strong>Error:</strong>
                      <pre>{action.result.error || "No error"}</pre>
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
